import React from "react";
import { firstName } from "./App";

const CompC = ()=>{
    
    return (
        <> 
            <firstName.Consumer>
                {(fname)=>{
                    return <h1>My name is {fname}</h1>
                }}
            </firstName.Consumer>
        </>
    )
}

export default CompC;
